    <div className="App">
    <NavBar></NavBar>



    <Router>


        {/* A <Switch> looks through its children <Route>s and
            renders the first one that matches the current URL. */}
        <Switch>
          <Route path="/about">
            <History />
          </Route>
          <Route path="/users">
            <AppForm />
          </Route>
          <Route path="/">
         <AppCalendar/>
          </Route>
        </Switch>
    </Router>



    </div>
  );
}

export default App;
